Classic Star Wars - Han Solo at Stars' End (1997) (Digital) (Bean-Empire)

An adaptation of the original novel. Brief promotional summary of the novel's plot - &quot;Searching the galaxy for a rogue shipbuilder to repair the Millenium Falcon, Han Solo and Chewbacca battle fierce enemies and travel to the desolate asteroid known as Stars' End, a planetary prison.&quot;

This is the new digital copy by Bean-Empire. Thanks to them for their efforts; please seed and enjoy! :-)

